import './createTable.css';

export default function CreateTable() {
    return (
        <>
            <div className="wrapper">
                <div className='row'>
                    <div>1</div>
                    <div>2</div>
                    <div>3</div>
                    <div>4</div>
                    <div>5</div>
                </div>
            </div>
        </>
    )
}
